  VALUES ('20122','d9bd130b-7f26-4c9c-93dd-e46f09ac3ad8','admin',TO_DATE( '20120613163905', 'YYYYMMDDHH24MISS' ),'Pays attention to verbal expression; forms and genres; and historical, cultural, and conceptual contexts of the natural environment. Focuses on sites, nations, and historical periods. Forms and genres include: nature writing, environmentalist discourses, the pastoral, the sublime, discourses of the city , fiction, poetry, nonfiction prose, dramatic forms, and religious texts. Offered: AWSpS.','Pays attention to verbal expression; forms and genres; and historical, cultural, and conceptual contexts of the natural environment. Focuses on sites, nations, and historical periods. Forms and genres include: nature writing, environmentalist discourses, the pastoral, the sublime, discourses of the city , fiction, poetry, nonfiction prose, dramatic forms, and religious texts. Offered: AWSpS.','02c4982b-2399-44d6-ba6c-7f9507a87aad','kuali.lui.course.offering.state.offered','kuali.lui.type.course.offering',15,1,'3665973c-e698-47fc-850e-f4bce22af18c','admin',TO_DATE( '20120613163905', 'YYYYMMDDHH24MISS' ),0)
