  VALUES ('20122','1573cfa2-adc8-40a1-a01e-8500c0017c28','admin',TO_DATE( '20120613164230', 'YYYYMMDDHH24MISS' ),'Third course in a three-quarter overview of chemistry. Not for students majoring in biochemistry, chemistry, or engineering. Includes alcohols, phenols, ethers, aldehydes, ketones, carboxylic acids, amines, and structural determination. Only 5 credits can be counted toward graduation from the following: CHEM 221, CHEM 223, CHEM 237, CHEM 335. Prerequisite: 1.7 in CHEM 220. Offered: Sp.','Third course in a three-quarter overview of chemistry. Not for students majoring in biochemistry, chemistry, or engineering. Includes alcohols, phenols, ethers, aldehydes, ketones, carboxylic acids, amines, and structural determination. Only 5 credits can be counted toward graduation from the following: CHEM 221, CHEM 223, CHEM 237, CHEM 335. Prerequisite: 1.7 in CHEM 220. Offered: Sp.','046c95d7-b2ef-4513-910c-94ac255b9dd1','kuali.lui.course.offering.state.offered','kuali.lui.type.course.offering',216,1,'d937425b-842f-45d1-987c-6fbda7334581','admin',TO_DATE( '20120613164230', 'YYYYMMDDHH24MISS' ),0)
