  VALUES ('20122','06c0baf9-0db3-4fc0-8374-9efe8d0eebe3','admin',TO_DATE( '20120613163823', 'YYYYMMDDHH24MISS' ),'Intensive study of, and exercise in, applying important or influential interpretive practices for studying language, literature, and culture, along with consideration of their powers/limits. Focuses on developing critical writing abilities. Topics vary and may include critical and interpretive practice from scripture and myth to more contemporary approaches, including newer interdisciplinary practices. Prerequisite: minimum grade of 2.0 in ENGL 197 or ENGL 297; a minimum grade of 2.0 in ENGL 202 or ENGL 301; may not be repeated if received a grade of 2.0 or higher.','Intensive study of, and exercise in, applying important or influential interpretive practices for studying language, literature, and culture, along with consideration of their powers/limits. Focuses on developing critical writing abilities. Topics vary and may include critical and interpretive practice from scripture and myth to more contemporary approaches, including newer interdisciplinary practices. Prerequisite: minimum grade of 2.0 in ENGL 197 or ENGL 297; a minimum grade of 2.0 in ENGL 202 or ENGL 301; may not be repeated if received a grade of 2.0 or higher.','66bfab5a-be3f-4b86-90d9-af84072a978b','kuali.lui.course.offering.state.offered','kuali.lui.type.course.offering',40,1,'67a5d930-21d7-456f-a17d-4b62fedebeb2','admin',TO_DATE( '20120613163823', 'YYYYMMDDHH24MISS' ),0)
