  VALUES ('20122','618b3610-d940-4524-af5f-49efe3878f94','admin',TO_DATE( '20120613164257', 'YYYYMMDDHH24MISS' ),'For chemistry majors and otherwise qualified students planning three or more quarters of organic chemistry. Structure, nomenclature, reactions, and synthesis of organic compounds. Theory and mechanism of organic reactions. Studies of biomolecules. Includes introduction to membranes, enzyme mechanisms, prosthetic groups, macromolecular conformations, and supramolecular architecture. No more than 4 credits can be counted toward graduation from the following course groups: CHEM 239, CHEM 337. Prerequisite: 2.2 in CHEM 336. Offered: Sp.','For chemistry majors and otherwise qualified students planning three or more quarters of organic chemistry. Structure, nomenclature, reactions, and synthesis of organic compounds. Theory and mechanism of organic reactions. Studies of biomolecules. Includes introduction to membranes, enzyme mechanisms, prosthetic groups, macromolecular conformations, and supramolecular architecture. No more than 4 credits can be counted toward graduation from the following course groups: CHEM 239, CHEM 337. Prerequisite: 2.2 in CHEM 336. Offered: Sp.','6b89a0f3-be7e-4a0f-81b8-a42b178885c7','kuali.lui.course.offering.state.offered','kuali.lui.type.course.offering',40,1,'c5ffdf0c-5c07-4596-b429-bf8795328d5c','admin',TO_DATE( '20120613164257', 'YYYYMMDDHH24MISS' ),0)
